window.bookSummaryJSON = "<p><b>Multiverse Z came knocking, snatching all the humans from Earth to integrate with their game-like realms of magic.</b></p> <p>No warning. No tutorial. It's an instant transition where eighteen-year-old Joey Eclipse is thrust from his relaxing night playing video games to a stone room with two doors. There's nobody but him.</p> <p>The system messages asking some cryptic questions:</p> <p>[Adventurer or Commoner?]</p> <p>[Greatness or Steadiness?]</p> <p>And more.</p> <p>Joey made his choices, choosing the path of a Great Adventurer, a limited and special category. A unique profile is designed for him. A new realm with endless possibilities and vicious monsters awaits him. The perfect environment to test his powerful spells and many skills and grow within the multiverse system. Despite the challenges from these drastic changes, Joey can't help but smile.</p> <p>He's excited to ascend the realms of Multiverse Z.</p> <p><i>Join Joey on a new apocalypse initialization where humans from his old world are integrated into a game-like universe filled with multiple realms with various fantasy themes. In this LitRPG are levels, stats, skills, spells, achievement hunts, and a main character who's more action-orientated and a bit ruthless when facing PVP or PVE events.</i></p>"; 
